import React from "react";
import { Link } from "react-router-dom";
import "./header/styles.scss";

const Header = () => {
  return (
    <div className="header">
      <div className="logo">
        <p>saad</p>
      </div>
      <div className="options">
        <Link className="option" to="/shop">
          SHOP
        </Link>
        <Link className="option" to="/shop">
          CONTACT
        </Link>
      </div>
    </div>
  );
};

export default Header;
